  <script>
    let countdown = 20; // 20 seconds countdown
    const targetUrl = "https://mxdrop.to/f/z1xmg74xson7p0"; // Replace with your target URL

    // Update the timer every second
    function updateTimer() {
      const timerElement = document.getElementById("timer");
      timerElement.textContent = countdown;
      if (countdown <= 0) {
        window.location.href = targetUrl; // Redirect when countdown ends
      } else {
        countdown--;
        setTimeout(updateTimer, 1000); // Call this function again after 1 second
      }
    }

    // Start the timer on page load
    window.onload = updateTimer;
  </script>
